void masPrint() {
    for(int i = 0; i < n; i++){
        std::cout << mas[i] << (i == n - 1 ? "\n" : " ");
    }
}

int main() {
    masPrint();
    int left = 0, right = n - 1; // начальные значения границ

    float pivot; // Элемент по середине массива

    std::vector <int> taskQueue {0};

    taskQueue.push_back(left);
    taskQueue.push_back(right);

    do {
        right = taskQueue.back();
        taskQueue.pop_back();
        left = taskQueue.back();
        taskQueue.pop_back();

        int i = left, j = right; // Итераторы границ левый правый

        pivot = mas[(i + j) / 2]; // Опорний элемент поиска в середине массива

        do {                                                        //| ОСНОВНОЙ АЛГОРИТМ
                                                                    //|
            while (mas[i] < pivot) {                                //|
                i++; //Ищем элемент меньше среднего                 //|
            }                                                       //|
                                                                    //|
            while (mas[j] > pivot) {                                //|
                j--; //Ищем элемент больше среднего                 //|
            }                                                       //|
                                                                    //|
            if (i <= j) { // Меняем местами найденные элементы      //|
                float t = mas[i];                                   //|
                mas[i] = mas[j];                                    //|
                mas[j] = t;                                         //|
                i++; //Смещаем индексы                              //|
                j--; //Смещаем индексы                              //|
            }                                                       //|
        } while (i <= j);                                           //|  ОСНОВНОЙ АЛГОРИТМ

        if(left < j){
            taskQueue.push_back(left);
            taskQueue.push_back(j);
        }
        if(i < right){
            taskQueue.push_back(i);
            taskQueue.push_back(right);
        }
    } while (taskQueue.size() > 1);

    std::cout << "Sorted array is \n";
    masPrint();
}